import React from 'react';
import { Header } from '../components/Header/Header';
import { Footer } from '../components/Footer/Footer';
import { 
    Homepage, 
    H1,
    HomepageLink
} from '.';

const WeSchedule = () => {
    return (
        <div>
            <Homepage>
				<H1 id="logo"><HomepageLink href="/">Megan Chong</HomepageLink></H1>
			</Homepage>
            <Header height="15vh"/>
            <Footer/>
        </div>
    )
}

export default WeSchedule;
